129	Amony fit	t	2019-09-14 13:01:39.354339+00	963390263:AAEIBLAh66lZ8gv9RQx0IWtV2Vkw71F8I3s	f	on	true	[[{"id": "fb8aaf73-9b0e-4f1b-8ca0-2b169efb84c0", "name": "Приветствие", "elements": [{"id": "055a057f-7619-4aa5-911d-e759267991ee", "data": {"text": "EMS фитнес  — это эффективная тренировка, которая поможет намного быстрее достичь желаемого результата. \\nТренер следит за правильностью выполнения упражнений и распределением нагрузки. Во время занятий микротоки сокращают даже глубокие мышцы, которые сложно задействовать с помощью упражнений в тренажерном зале.\\nЭлектромиостимуляция также воздействует на гладкие и скелетные мышцы, поэтому 20-минутные занятия позволяют достичь такого же результата, как за 2 часа тренировок в спортзале. \\nОдно из главных преимуществ EMS фитнеса — это деликатное воздействие на глубинные мышцы без дополнительной нагрузки на опорно-двигательный аппарат.\\nЭМС тренировка завершается лимфодренажным массажем, который проводится с помощью специального режима подачи импульсов.", "value": [{"id": "7e5bb4e5-9857-4a46-bf40-d7abf1eb1bdc", "text": "Сколько Стоит"}, {"id": "0e35db19-98c1-4269-aca3-8622a526ca22", "text": "Подробнее"}, {"id": "391c97d0-9141-407f-b5d5-fab63bace151", "text": "Записаться"}, {"id": "fb8aaf73-9b0e-4f1b-8ca0-2b169efb84c0", "text": "Приветствие"}], "fallback": ""}, "type": "menu"}]}, {"id": "7e5bb4e5-9857-4a46-bf40-d7abf1eb1bdc", "name": "Сколько стоит", "elements": [{"id": "66825af0-c5f1-485d-ba61-fe7762c9953e", "data": {"text": "Пробная тренировка 600 рублей\\nРазовая тренировка 1950 рублей\\nАбонемент на 8 тренировок 14000 рублей\\nАбонемент на 12 тренировок 18000 рублей", "value": [{"id": "391c97d0-9141-407f-b5d5-fab63bace151", "text": "Записаться"}, {"id": "0e35db19-98c1-4269-aca3-8622a526ca22", "text": "Подробнее"}, {"id": "7e5bb4e5-9857-4a46-bf40-d7abf1eb1bdc", "text": "Сколько стоит"}, {"id": "fb8aaf73-9b0e-4f1b-8ca0-2b169efb84c0", "text": "Приветствие"}], "fallback": ""}, "type": "menu"}]}, {"id": "0e35db19-98c1-4269-aca3-8622a526ca22", "name": "Подробнее", "elements": [{"id": "3462f681-8ef7-4db3-b4ca-13fe3764f275", "data": {"text": "Как технология EMS тренировок влияет на ваше тело?\\n\\n1. Сжигает «трудные» жировые отложения на задней поверхности рук.\\n\\n2. Оздоравливает, улучшает кровообращение и обмен веществ без активных тренировок.\\n\\n3. Способствует похудению и устранению целлюлита.\\n\\n4. Активирует «спящие» мышечные волокна и провоцирует рост мышц даже без больших весов.\\n\\n5. Ускоряет восстановление после травм и операций.\\n\\n6. Укрепляет спину и грудь - для вашей идеальной осанки.\\n\\nЗапишитесь на первую тренировку и увидите результат", "value": [{"id": "0e35db19-98c1-4269-aca3-8622a526ca22", "text": "Подробнее"}, {"id": "fb8aaf73-9b0e-4f1b-8ca0-2b169efb84c0", "text": "Приветствие"}, {"id": "7e5bb4e5-9857-4a46-bf40-d7abf1eb1bdc", "text": "Сколько стоит"}, {"id": "391c97d0-9141-407f-b5d5-fab63bace151", "text": "Записаться"}], "fallback": ""}, "type": "menu"}]}, {"id": "391c97d0-9141-407f-b5d5-fab63bace151", "name": "Записаться", "elements": [{"id": "ecae5d49-7484-4256-bcc9-572fdb018a31", "data": {"text": "Записаться можно по ссылке: https://n229024.yclients.com/company:226204?o=m-1", "value": [{"id": "391c97d0-9141-407f-b5d5-fab63bace151", "text": "Записаться"}, {"id": "fb8aaf73-9b0e-4f1b-8ca0-2b169efb84c0", "text": "Приветствие"}, {"id": "7e5bb4e5-9857-4a46-bf40-d7abf1eb1bdc", "text": "Сколько стоит"}, {"id": "0e35db19-98c1-4269-aca3-8622a526ca22", "text": "Подробнее"}], "fallback": ""}, "type": "menu"}]}]]	2019-08-14 12:28:16.073122+00	53
