130	Тыва манчы	t	2019-09-17 10:30:43.608456+00	950400665:AAHpJYKyK9ztqiCqm4q858ylhCA1CiawVhI	f	on	true	[[{"id": "27c7af71-d4c2-4278-8820-d9cf80d4b340", "name": "Приветствие", "elements": [{"id": "4cbd6660-7ac5-4afc-9dd5-9c350a86a180", "data": {"text": "Здравсвуйте! Я чат-бот Тувинских пельменей.\\nМеня создали для заказа пельменей не выходя из мессенджера.\\n\\nЯ умею:\\n✅Показывать товары\\n✅Принимать заказы\\n✅Рассказывать о новостях\\n✅Напоминать о Ваших покупках\\n✅Показывать историю заказов", "value": [{"id": "28f5d6f7-ec36-4e40-a368-9ee527c7bf49", "text": "Меню"}, {"id": "27c7af71-d4c2-4278-8820-d9cf80d4b340", "text": "Доставка"}, {"id": "27c7af71-d4c2-4278-8820-d9cf80d4b340", "text": ""}], "fallback": ""}, "type": "menu"}]}, {"id": "28f5d6f7-ec36-4e40-a368-9ee527c7bf49", "name": "Меню", "elements": [{"id": "09c8b660-fd3c-4a5d-bbe8-23a2f0d59cbc", "data": {"text": "Все категории", "value": [{"id": "2a728932-b5c6-4b5b-848e-acacc5889c69", "text": "Пельмени"}, {"id": "22575248-0250-4b03-ad40-b2a200514643", "text": "Закуски"}, {"id": "f847fe27-267c-4446-ae32-ce6d8b0ec663", "text": "Салаты"}, {"id": "8e9593fd-31da-4cc9-9c73-b4baca693fad", "text": "Напитки"}], "fallback": ""}, "type": "menu"}]}, {"id": "2a728932-b5c6-4b5b-848e-acacc5889c69", "name": "Пельмени", "elements": [{"id": "8f255c08-bbb0-46b6-9819-24f620a01821", "data": {"text": "Пельмени с говядиной (15шт) -180 р\\n\\nПельмени домашние (свинина/говядина 15 шт.) -180 р\\n\\nБурятские мини-буузы (говядина/свинина 10шт) - 180 р\\n\\nБурятские буузы традиционные (говядина 1шт) - 80 р", "image": "https://inbot24.ru/media/upload_photos/130/156578980501749600_308347e9-258f-4cbc-b4a5-c5e50cde3631.JPG"}, "type": "image"}, {"id": "736d1dc5-db33-42b0-a3c0-b83140e20e1c", "data": {"text": "Пельмени и блузы", "value": [{"id": "2a728932-b5c6-4b5b-848e-acacc5889c69", "text": "Пельмени с говядиной"}, {"id": "2a728932-b5c6-4b5b-848e-acacc5889c69", "text": "Пельмени домашние"}, {"id": "2a728932-b5c6-4b5b-848e-acacc5889c69", "text": "Бурятские мини-буузы"}, {"id": "2a728932-b5c6-4b5b-848e-acacc5889c69", "text": "Бурятские буузы традиционные"}], "fallback": ""}, "type": "menu"}]}], [{"id": "effc05ed-157f-4ef0-8b25-84000659a929", "name": "доставка", "elements": [{"id": "602f842d-5cfd-4927-b8c7-fd3d031b3493", "data": {"text": "В ближайшее время мы подключим доставку через \\"Яндекс.еда\\", а пока что мы работаем через один способ - \\"самовывоз\\". Спасибо за понимание", "value": [{"id": "28f5d6f7-ec36-4e40-a368-9ee527c7bf49", "text": "Меню"}], "fallback": ""}, "type": "menu"}]}, {"id": "f847fe27-267c-4446-ae32-ce6d8b0ec663", "name": "Салаты", "elements": [{"id": "55e7e626-8357-4e38-93e2-79ff842c2b79", "data": {"text": "Здесь будут салаты", "value": [{"id": "28f5d6f7-ec36-4e40-a368-9ee527c7bf49", "text": "Меню"}], "fallback": ""}, "type": "menu"}]}, {"id": "22575248-0250-4b03-ad40-b2a200514643", "name": "Закуски", "elements": [{"id": "e34f574b-b0a1-4e8c-9a7c-4dacc689f236", "data": {"text": "Тувинский чебурек \\"Хужуур\\" - 55 р", "image": "https://inbot24.ru/media/upload_photos/130/156579046439324960_0bd1d3a9-abb9-4948-afab-4d863d55c146.JPG"}, "type": "image"}, {"id": "19a11906-09e8-4b6c-9f7b-078a6ef00ae0", "data": {"text": "Все закуски", "value": [{"id": "28f5d6f7-ec36-4e40-a368-9ee527c7bf49", "text": "Меню"}], "fallback": ""}, "type": "menu"}]}, {"id": "8e9593fd-31da-4cc9-9c73-b4baca693fad", "name": "Напитки", "elements": [{"id": "72c89d2a-4f6f-499f-a877-bdab87213255", "data": {"text": "Чай с молоком - 30 р\\nЧерный чай - 30 р\\nХаан чай - 30 р", "value": [{"id": "28f5d6f7-ec36-4e40-a368-9ee527c7bf49", "text": "Меню"}], "fallback": ""}, "type": "menu"}]}]]	2019-08-14 13:00:00.05378+00	54
