u0435\\u0440\\u0448\\u0430\\u0435\\u0442\\u0441\\u044f \\u043b\\u0438\\u043c\\u0444\\u043e\\u0434\\u0440\\u0435\\u043d\\u0430\\u0436\\u043d\\u044b\\u043c \\u043c\\u0430\\u0441\\u0441\\u0430\\u0436\\u0435\\u043c, \\u043a\\u043e\\u0442\\u043e\\u0440\\u044b\\u0439 \\u043f\\u0440\\u043e\\u0432\\u043e\\u0434\\u0438\\u0442\\u0441\\u044f \\u0441 \\u043f\\u043e\\u043c\\u043e\\u0449\\u044c\\u044e \\u0441\\u043f\\u0435\\u0446\\u0438\\u0430\\u043b\\u044c\\u043d\\u043e\\u0433\\u043e \\u0440\\u0435\\u0436\\u0438\\u043c\\u0430 \\u043f\\u043e\\u0434\\u0430\\u0447\\u0438 \\u0438\\u043c\\u043f\\u0443\\u043b\\u044c\\u0441\\u043e\\u0432.", "keyboard": ["\\u0421\\u043a\\u043e\\u043b\\u044c\\u043a\\u043e \\u0421\\u0442\\u043e\\u0438\\u0442", "\\u041f\\u043e\\u0434\\u0440\\u043e\\u0431\\u043d\\u0435\\u0435", "\\u0417\\u0430\\u043f\\u0438\\u0441\\u0430\\u0442\\u044c\\u0441\\u044f", "\\u041f\\u0440\\u0438\\u0432\\u0435\\u0442\\u0441\\u0442\\u0432\\u0438\\u0435"]}	{"message_id": 55, "from": {"id": 963390263, "is_bot": true, "first_name": "Amonyfit", "username": "Amonyfit_bot"}, "chat": {"id": 787069789, "first_name": "Ayrat", "last_name": "Tonduvai", "type": "private"}, "date": 1565798464, "text": "EMS фитнес  — это эффективная тренировка, которая поможет намного быстрее достичь желаемого результата. \\nТренер следит за правильностью выполнения упражнений и распределением нагрузки. Во время занятий микротоки сокращают даже глубокие мышцы, которые сложно задействовать с помощью упражнений в тренажерном зале.\\nЭлектромиостимуляция также воздействует на гладкие и скелетные мышцы, поэтому 20-минутные занятия позволяют достичь такого же результата, как за 2 часа тренировок в спортзале. \\nОдно из главных преимуществ EMS фитнеса — это деликатное воздействие на глубинные мышцы без дополнительной нагрузки на опорно-двигательный аппарат.\\nЭМС тренировка завершается лимфодренажным массажем, который проводится с помощью специального режима подачи импульсов."}	2019-08-14 16:01:04.275125+00	129	30
