0445 \\u0432\\u0435\\u0441\\u043e\\u0432.\\n\\n5. \\u0423\\u0441\\u043a\\u043e\\u0440\\u044f\\u0435\\u0442 \\u0432\\u043e\\u0441\\u0441\\u0442\\u0430\\u043d\\u043e\\u0432\\u043b\\u0435\\u043d\\u0438\\u0435 \\u043f\\u043e\\u0441\\u043b\\u0435 \\u0442\\u0440\\u0430\\u0432\\u043c \\u0438 \\u043e\\u043f\\u0435\\u0440\\u0430\\u0446\\u0438\\u0439.\\n\\n6. \\u0423\\u043a\\u0440\\u0435\\u043f\\u043b\\u044f\\u0435\\u0442 \\u0441\\u043f\\u0438\\u043d\\u0443 \\u0438 \\u0433\\u0440\\u0443\\u0434\\u044c - \\u0434\\u043b\\u044f \\u0432\\u0430\\u0448\\u0435\\u0439 \\u0438\\u0434\\u0435\\u0430\\u043b\\u044c\\u043d\\u043e\\u0439 \\u043e\\u0441\\u0430\\u043d\\u043a\\u0438.\\n\\n\\u0417\\u0430\\u043f\\u0438\\u0448\\u0438\\u0442\\u0435\\u0441\\u044c \\u043d\\u0430 \\u043f\\u0435\\u0440\\u0432\\u0443\\u044e \\u0442\\u0440\\u0435\\u043d\\u0438\\u0440\\u043e\\u0432\\u043a\\u0443 \\u0438 \\u0443\\u0432\\u0438\\u0434\\u0438\\u0442\\u0435 \\u0440\\u0435\\u0437\\u0443\\u043b\\u044c\\u0442\\u0430\\u0442", "keyboard": ["\\u041f\\u043e\\u0434\\u0440\\u043e\\u0431\\u043d\\u0435\\u0435", "\\u041f\\u0440\\u0438\\u0432\\u0435\\u0442\\u0441\\u0442\\u0432\\u0438\\u0435", "\\u0421\\u043a\\u043e\\u043b\\u044c\\u043a\\u043e \\u0441\\u0442\\u043e\\u0438\\u0442", "\\u0417\\u0430\\u043f\\u0438\\u0441\\u0430\\u0442\\u044c\\u0441\\u044f"]}	{"message_id": 75, "from": {"id": 963390263, "is_bot": true, "first_name": "Amonyfit", "username": "Amonyfit_bot"}, "chat": {"id": 787069789, "first_name": "Ayrat", "last_name": "Tonduvai", "type": "private"}, "date": 1567455877, "text": "Как технология EMS тренировок влияет на ваше тело?\\n\\n1. Сжигает «трудные» жировые отложения на задней поверхности рук.\\n\\n2. Оздоравливает, улучшает кровообращение и обмен веществ без активных тренировок.\\n\\n3. Способствует похудению и устранению целлюлита.\\n\\n4. Активирует «спящие» мышечные волокна и провоцирует рост мышц даже без больших весов.\\n\\n5. Ускоряет восстановление после травм и операций.\\n\\n6. Укрепляет спину и грудь - для вашей идеальной осанки.\\n\\nЗапишитесь на первую тренировку и увидите результат"}	2019-09-02 20:24:37.527397+00	129	30
